				CreateTestFileForStats($SelectedClass,$NewStatComboArray,$Build['BuildId'],$BuildName);
			}
		}
		else
		{
			$Stat = substr( $Stat1, 1, -1 );
//echo "$Stat1 - $Stat<br>";die();		
			CreateTestFileForStats($SelectedClass,array($Stat),$Build['BuildId'],$BuildName);		
		}
	}
	echo "$BuildName) Generated $FilesCreated combinations using $StatsInFile stats out of a pool of $TotalTried<br>";
}

