function PrintDescendingDPSList($i,$RowLimit)
{
	global $Builds;
//	for($i=1;$i<15;$i++)
	{
		//create a table for each of the stat combos
		if(!isset($Builds[0]['StatDPSValues'][$i]))
			continue;
		echo "<table border=1>";
		echo "<tr>";
		foreach($Builds as $key => $Build)
			echo "<td>".$Build['BuildName']."</td><td></td>";
		echo "</tr>";
		foreach($Builds as $key => $Build)
		{
			//generate an ordered list of DPS values
			$StatDPSListOrdered = $Build['StatDPSValues'][$i];
			arsort($StatDPSListOrdered);
			$RowCount = 0;
			foreach($StatDPSListOrdered as $StatCombo => $DPS)
			{
				if($RowCount > $RowLimit)
					break;
				$CellData[$RowCount][$key * 2 + 0] = $StatCombo;
				$CellData[$RowCount][$key * 2 + 1] = $DPS;
				$RowCount++;
			}
		}
		for($Row = 0; $Row < $RowLimit; $Row++)
		{
			$row = "<tr>";
			$RowHasValues = 0;
			foreach($Builds as $key => $Build)
			{
				$BuildName = $Build['BuildName'];
				if(!isset($CellData[$Row][$key * 2]))
					$row .= "<td></td><td></td>";
				else
				{
					$row .= "<td>".$CellData[$Row][$key * 2 + 1]."</td>"."<td>".GetStatComboString($CellData[$Row][$key * 2 + 0])."</td>";
					$RowHasValues++;
				}
			}	
			$row .= "</tr>\n";
			if($RowHasValues > 0)
				echo $row;
			else
				break;
		}
		echo "</table><br><br>";
	}
}

function GetStatComboString($StatComboValues)
{
	global $IRS;
	$parts = explode(",",$StatComboValues);
	$ret = "";
	foreach($parts as $key => $val)
		$ret .= $IRS[$val].",";
	$ret = substr($ret, 0, -1 );
	$ret = str_replace("%d","",$ret);
	$ret = str_replace("%.02f","",$ret);
	$ret = str_replace("%%","%",$ret);
	return $ret;
}

