		$Builds[$key]['MinAccepted'][2] = $Builds[$key]['StatDPSValues'][1][",0,"] * 1.5;
		for($i=3;$i<15;$i++)
			$Builds[$key]['MinAccepted'][$i] = $Builds[$key]['StatDPSValues'][1][",0,"] * (1.3 + $i * 0.2);
	}
	$GenerateOnlyInexisting = 0;
