function SetLimitsTopXFromCountSkipUseless($lvl1Limit, $LvlXLimit)
{
	global $ExpectedDPSLimit, $GenerateOnlyInexisting, $StatsInFile, $Builds;
	foreach($Builds as $key => $Build)
	{
		for($i=1;$i<15;$i++)
		{
			if(!isset($Builds[$key]['StatDPSValues'][$i]))
				continue;
			arsort($Builds[$key]['StatDPSValues'][$i]);
			$count = count($Builds[$key]['StatDPSValues'][$i]);
			if($i==1)
				$LimitIsAtIndex = $lvl1Limit;
			else
				$LimitIsAtIndex = $LvlXLimit;
			$UselessLimit = $Builds[$key]['StatDPSValues'][1][",0,"] * 1.4; //valid for lvl 1 only ?
			foreach($Builds[$key]['StatDPSValues'][$i] as $Stat => $DPS)
			{
//echo "Stat $Stat has too small DPS $DPS to be tested now<br>";
				if($LimitIsAtIndex<=0 || $DPS < $UselessLimit)
				{
echo "Set DPS limit $DPS for build ".$Builds[$key]['BuildName']." and stat combo count $i<br>";		
					$Builds[$key]['MinAccepted'][$i] = $DPS;
					break;
				}
				$LimitIsAtIndex--;
			}
		}
	}
	$GenerateOnlyInexisting = 0;
}

function SetLimitsTopXPCTAndMeaningFullLvl1($X,$Lvl1Limit)
{
	global $ExpectedDPSLimit, $GenerateOnlyInexisting, $StatsInFile, $Builds;
	foreach($Builds as $key => $Build)
	{
		for($i=1;$i<15;$i++)
		{
			if(!isset($Builds[$key]['StatDPSValues'][$i]))
				continue;
			asort($Builds[$key]['StatDPSValues'][$i]);
			$count = count($Builds[$key]['StatDPSValues'][$i]);
			$LimitIsAtIndex = $count - $count * $X / 100;
			foreach($Builds[$key]['StatDPSValues'][$i] as $Stat => $DPS)
			{
//echo "Stat $Stat has too small DPS $DPS to be tested now<br>";
				if($LimitIsAtIndex<=0)
				{
echo "Set DPS limit $DPS for build ".$Builds[$key]['BuildName']." and stat combo count $i<br>";		
					$Builds[$key]['MinAccepted'][$i] = $DPS;
					break;
				}
				$LimitIsAtIndex--;
			}
		}
		if($Lvl1Limit>0)
			$Builds[$key]['StatDPSValues'][1] = $Builds[$key]['StatDPSValues'][1][",0,"] * $Lvl1Limit;
	}
	$GenerateOnlyInexisting = 0;
}

function Array2Str($arr)
{
	$ret = ",";	
	foreach($arr as $key => $Stat)
		$ret .= "$Stat,";
	return $ret;
}

function GenNewStatCombo($Stat1,$StatCombo2)
{
	$NewStatCombo = substr( $Stat1, 0, -1).$StatCombo2;	
	$parts = explode(",",$NewStatCombo);
	$Counter = 0;
	foreach($parts as $key => $Stat)
		if($Stat != "")
			$StatCombos[$Counter++]=$Stat;
	asort($StatCombos);
	return $StatCombos;
}

function CreateTestFileForStats($SelectedClass,$StatCombos,$BuildId, $BuildName)
{
	global $StatsInFile, $FilesCreated, $OutputDir, $TimeToSampleDPS;
//$FilesCreated++;return;
	$TargetClass = 65535;
	$FileName = $OutputDir."Test_${SelectedClass}_${StatsInFile}_${FilesCreated}_${BuildId}.txt";
	$f = fopen($FileName, "wt");
	if(!$f)
	{
		echo "Could not open output file $FileName<br>";
		return;
	}
	fputs($f,(1<<$SelectedClass)."\n"); //allowed class mask
	fputs($f,"1\n"); // allow targetting mobs
	fputs($f,$TargetClass."\n"); // allow targetting mobs

//echo "$StatCombo<br>"; print_r($StatCombos);print_r($parts);die();		
	//list of stats
	$StatsLine = "";
	for($j=0;$j<$StatsInFile;$j++)
	{
		$ItemSlot = $j % 15;
		$SelectedSat = $StatCombos[$j];
		$SelectedStatMaxVal = GetStatMaxVal($StatsInFile, $SelectedSat);
		$StatsLine .= "-1 $SelectedSat $SelectedStatMaxVal ";
//echo "$StatsLine<br>";
	}	
	fputs($f,$StatsLine."\n");
	
	fputs($f,"$TimeToSampleDPS\n");
	
	fputs($f,"${BuildId}\n");
	
	fputs($f,"${BuildName}\n");
	
	//full format has been written to file
	fclose($f);
	$FilesCreated++;
//	die("all done");
}

