function Merge2Arrays($OldList,$NewList)
{
	$ret = array();
	foreach($OldList as $Stat => $DPS)
		$ret["$Stat"] = $DPS;
	foreach($NewList as $Stat => $DPS)
		$ret["$Stat"] = $DPS;
	return $ret;
}

function GetStatMaxVal( $NumberOfStatTypesOurItemsHave, $CurStatType )
{
	$TotalItemsPlayerCanEquip = 19;
	$NumberOfStatsItemCanHave = 15;
	$TotalStatCount = $TotalItemsPlayerCanEquip * $NumberOfStatsItemCanHave;
	$SlotsThisStatCanTake = ($TotalStatCount / $NumberOfStatTypesOurItemsHave);
	$TheoreticalMaxVal = $SlotsThisStatCanTake * GetMaxValStat($CurStatType);
	$PracticalMaxVal = $TheoreticalMaxVal / 10;
	return $PracticalMaxVal;
}

function GetMaxValStat( $stat )
{
	global $IRNRL;
	if( $stat[0] == ',' )
		$stat = substr($stat,1,-1);
	if( is_array($stat) ) { echo "we are expecting a stat index, but we got "; print_r($stat); echo "<br>"; }
	if( !isset($IRNRL[$stat]) ) echo "We are looking for stat $stat, but it is not defined<br>";
	return $IRNRL[$stat] * 15; // 10 from difficulty, and 5 from MFP
}

